import { getClassroomList } from "../../../api_handler/classroom_api_handler";
import { getUserId, getUserToken } from "../../../cookie_handler/user_cookie_handler";

export async function fetchClassroomList(setIsLoading, setClassroomList) {
    let classroomList

    try {
        classroomList = await getClassroomList(getUserId(), getUserToken())
    } catch(e) {
        alert(e)
    }

    console.log(classroomList)
    setClassroomList(classroomList)
    return classroomList
}
